import React from 'react';

class Search extends React.Component {
    onSearch(e){
        e.preventDefault();
    }
    render() {
        return (
            <div>
                <form className="ui fluid icon input">
                    <h3 className="ui header">Search</h3>
                    <input type="text" placeholder="Search..."></input>
                </form>
            </div>
        )
    }
}

export default Search;
